import React, { Component } from "react";
import { Link } from "react-router-dom";
import Sak from "./Sak";

export default class News extends Component<{
  title?: string,
  src?: string,
  alt?: string,
  href?: string,
  colSize?: int
}> {
  render() {
    return (
      <div className={"col-sm-" + this.props.colSize}>
        <Link className="text-body" exact to={this.props.href}>
          <div
            className="card mx-auto bg-danger border-0 h-75"
            style={{ width: "auto" }}
          >
            <div>
              <img
                src={this.props.src}
                className="img-fluid"
                alt={this.props.alt}
              />
            </div>
            <div className="card-body">
              <h1 className="text-center">{this.props.title}</h1>
            </div>
          </div>
        </Link>
      </div>
    );
  }
}
